import React, {Component} from 'react';
import {
    BrowserRouter,
    Switch,
    Route,
    Link,
    useParams,
    useRouteMatch
} from "react-router-dom";


class TestFull extends Component {
    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            range: [],
            models: [],

        }
        this.qq=1;
        this.cc=1;

    }
    componentDidMount(){
        let combo=window.location.pathname.split('/');
        this.qq=combo[2]
        const res = fetch("http://127.0.0.1:8000/prizivniki/"+this.qq)
        .then (res => res.json())
        .then(

            (result) =>{
                this.setState({
                    isLoaded:true,
                    range: result,
                });
                // this.range=result;

            },
            (error) =>{
            this.setState({
                isLoaded:false,
                error});
            }
        )
        const res2 = fetch("http://127.0.0.1:8000/categoriya/"+this.cc)
        .then (res2 => res2.json())
        .then(

            (result) =>{
                this.setState({
                    isLoaded:true,
                    cat: result,
                });
                // this.range=result;

            },
            (error) =>{
            this.setState({
                isLoaded:false,
                error});
            }
        )
    }
    render() {
        const {error, isLoaded, range, cat} = this.state;
        if (error) {
            return <p>ERROR</p>
        } else if (!isLoaded) {
            return <p>LOADING</p>
        } else {
            return (
                <div>
                    <div className={"surname"}>{range.surname}</div>
                    <div className={"name"}>{range.name}</div>
                    <div className={"patronymic"}>{range.patronymic}</div>
                    <div className={"vozrast"}>{range.vozrast}</div>
                    <div className={"otsrochka"}>{range.otsrochka}</div>
                    <div className={"adress"}>{range.adress}</div>
                </div>
            );
        }
    }
}

export default TestFull;
